import React, { Component } from 'react';
import ReactDOM from 'react-dom';

const MyInfo = () => {
    return (
        <div>
            <h1>Suraj Shrestha</h1>
            <p>Hello from me !!</p>
            <ul>
                <li>Japan</li>
                <li>Indonesia</li>
                <li>Thailand</li>
            </ul>
        </div>
    )
}

ReactDOM.render(<MyInfo/>, document.getElementById("root"));
